import React from "react";

const Form = ({onSubmit, onChange, onKeyDown, value, autocompleteList }) => (
    <form onSubmit={onSubmit}>
        <input
        type="text"
        placeholder="Search country"
        onChange={onChange}
        onKeyDown={onKeyDown}
        value={value}
        />
        <button>Szukaj</button>
        {autocompleteList}
    </form>
);

export default Form;
